<!doctype html>
<html lang="fa" dir="rtl">
<head>
<meta charset="utf-8"/>
<meta name="viewport" content="width=device-width,initial-scale=1"/>
<title>نقشه فروش استان‌ها</title>
<link href="https://fonts.googleapis.com/css2?family=Vazirmatn:wght@300;400;600;700&display=swap" rel="stylesheet">
<script src="https://cdn.jsdelivr.net/npm/chart.js"></script>
<script src="https://unpkg.com/@supabase/supabase-js"></script>
<style>
:root{
  --accent: #2b6ef6;
  --bg: linear-gradient(180deg,#f6f9ff 0%, #f3f6fb 100%);
}
html,body{height:100%;margin:0;font-family:'Vazirmatn', Tahoma, Arial, sans-serif;background:var(--bg);color:#0f172a}
.app{display:flex;align-items:flex-start;gap:28px;height:100vh;overflow:hidden}
.panel{position:fixed;left:24px;top:32px;width:340px;background:linear-gradient(180deg,#ffffff 0%, #fbfdff 100%);border-radius:16px;padding:20px;box-shadow:0 20px 50px rgba(11,35,92,0.08);z-index:50}
.panel h2{margin:0 0 6px 0;font-size:20px;color:#0f172a}
.panel .meta{color:#475569;font-size:13px;margin-bottom:12px}
.info-row{display:flex;justify-content:space-between;align-items:center;padding:8px 0;border-bottom:1px solid rgba(15,23,42,0.04)}
.info-row .label{color:#475569}
.info-row .value{font-weight:700;color:#0f172a}
.donut-wrap{display:flex;justify-content:center;margin:14px 0}
.donut{width:180px;height:180px;border-radius:50%;background:linear-gradient(180deg,#eaf2ff,#e7f0ff);position:relative;box-shadow:inset 0 8px 24px rgba(43,110,246,0.06)}
.donut::after{content:'';position:absolute;left:50%;top:50%;transform:translate(-50%,-50%);width:88px;height:88px;border-radius:50%;background:white}
.donut-label{position:absolute;left:50%;top:50%;transform:translate(-50%,-50%);font-weight:700;color:var(--accent);font-size:18px}
.form{display:flex;gap:10px;margin-top:10px;align-items:center}
input[type=number]{flex:1;padding:10px;border-radius:10px;border:1px solid #e6eefc;font-size:14px}
.btn{background:var(--accent);color:white;padding:10px 14px;border-radius:10px;border:none;cursor:pointer;box-shadow:0 8px 20px rgba(43,110,246,0.12)}
.map-area{flex:1;height:100vh;overflow:auto;padding:28px 24px}
.map-card{background:transparent;border-radius:16px;padding:16px;display:flex;justify-content:center}
svg{max-width:980px;height:auto;display:block;filter:drop-shadow(0 20px 50px rgba(11,35,92,0.06));}
svg path, svg g { transition: all .14s; cursor: pointer; fill:#eef6ff; stroke:#cbd5e1; stroke-width:.6px }
svg path:hover, svg g:hover { transform:translateY(-4px); filter:brightness(.98) }
.selected { fill: #ffd54f !important; stroke:#c28d00 !important; stroke-width:1.4px !important; filter:drop-shadow(0 14px 40px rgba(255,189,64,0.12)) !important }
@media(max-width:1000px){.panel{display:none}.map-area{padding:12px}}
.tooltip{position:fixed;display:none;background:white;padding:8px 10px;border-radius:8px;box-shadow:0 8px 22px rgba(2,6,23,0.08);pointer-events:none;font-size:13px;color:#111}
</style>
</head>
<body>
<div class="app">
  <div class="panel" id="panel" aria-live="polite">
    <h2>اطلاعات فروش استان</h2>
    <div class="meta">انتخاب استان برای مشاهده و ویرایش مقدار فروش</div>

    <div class="info-row"><div class="label">استان</div><div class="value" id="provinceName">-</div></div>
    <div class="info-row"><div class="label">فروش</div><div class="value" id="provinceValue">-</div></div>

    <div class="donut-wrap">
      <div class="donut" id="donutVisual"><div class="donut-label" id="donutPercent">0%</div></div>
    </div>

    <div class="form">
      <input id="salesInput" type="number" min="0" placeholder="مقدار جدید">
      <button id="saveBtn" class="btn">ثبت</button>
    </div>
  </div>

  <div class="map-area">

<script>
const SUPABASE_URL = "https://hdxxhgifllgmnxytroan.supabase.co";
const SUPABASE_KEY = "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6ImhkeHhoZ2lmbGxnbW54eXRyb2FuIiwicm9sZSI6ImFub24iLCJpYXQiOjE3NjIwNjMzMjYsImV4cCI6MjA3NzYzOTMyNn0.AVss4tebIoL7X6j61ICYbs-c4Z792-pZmUTJzJUbtAI";
const { createClient } = window.supabase;
      const supabase = createClient(SUPABASE_URL, SUPABASE_KEY);
let salesMap = {}, selected = null;

// helper to set data-name from title if needed already done in SVG extraction
function ensureDataNames() {
  document.querySelectorAll('svg').forEach(svg=>{
    svg.querySelectorAll('title').forEach(t=>{
      const txt = t.textContent.trim();
      // find closest parent path or g
      let p = t.parentElement;
      if(p && (p.tagName.toLowerCase()==='path' || p.tagName.toLowerCase()==='g')) {
        if(!p.getAttribute('data-name')) p.setAttribute('data-name', txt);
      } else {
        // try previous element sibling path
        let prev = t.previousElementSibling;
        if(prev && (prev.tagName.toLowerCase()==='path' || prev.tagName.toLowerCase()==='g')) {
          if(!prev.getAttribute('data-name')) prev.setAttribute('data-name', txt);
        }
      }
    });
  });
}

// color scale by value
function getColor(v){
  if(v>150) return '#0b63ff';
  if(v>100) return '#3f7bff';
  if(v>50) return '#8fb2ff';
  if(v>0) return '#dbe9ff';
  return '#eef6ff';
}

// update donut visual (conic gradient)
function updateDonut(value){
  const percent = Math.max(0, Math.min(100, Math.round((value/200)*100)));
  const angle = percent * 3.6;
  const donut = document.getElementById('donutVisual');
  donut.style.background = `conic-gradient(var(--accent) 0deg, var(--accent) ${angle}deg, #eaf2ff ${angle}deg)`;
  document.getElementById('donutPercent').innerText = percent + '%';
}

// load all sales and paint map
async function loadSales(){
  const { data, error } = await supabase.from('provinces').select('id, sales');
  if(error){ console.error(error); return; }
  data.forEach(r=> salesMap[r.id]= r.sales || 0);
  paintMap();
}

// paint map based on salesMap
function paintMap(){
  ensureDataNames();
  const nodes = document.querySelectorAll('svg path, svg g, [data-name]');
  nodes.forEach(n=>{
    const name = n.getAttribute('data-name') || n.getAttribute('id') || n.getAttribute('title');
    if(!name) return;
    const v = salesMap[name] || 0;
    try{ n.classList.remove('selected'); n.style.fill = getColor(v); }catch(e){}
    n.addEventListener('click', ()=>{
      // clear previous selected
      document.querySelectorAll('.selected').forEach(s=>s.classList.remove('selected'));
      try{ n.classList.add('selected'); }catch(e){}
      selected = name;
      document.getElementById('provinceName').innerText = name;
      document.getElementById('provinceValue').innerText = salesMap[name] || 0;
      document.getElementById('salesInput').value = salesMap[name] || 0;
      updateDonut(salesMap[name] || 0);
    });
  });
}

// save to supabase
async function saveSales(){
  if(!selected) return alert('ابتدا یک استان انتخاب کنید');
  const v = Number(document.getElementById('salesInput').value) || 0;
  const { error } = await supabase.from('provinces').upsert({ id:selected, sales:v });
  if(error){ alert('خطا در ذخیره: '+ error.message); return; }
  salesMap[selected] = v;
  document.getElementById('provinceValue').innerText = v;
  updateDonut(v);
  paintMap();
  alert('مقدار ذخیره شد ✅');
}

document.getElementById('saveBtn').addEventListener('click', saveSales);

// init
loadSales();
</script>

<script>
// انتخاب همه استان‌ها (تمام path هایی که data-name دارند)
const provinces = document.querySelectorAll('svg [data-name]');

// رنگ اولیه استان‌ها (قبل از انتخاب)
let defaultColor = "#D9D9D9";

// وقتی روی یک استان کلیک شد:
provinces.forEach(prov => {
    prov.addEventListener("click", function() {

        // بازگرداندن تمام استان‌ها به رنگ اولیه
        provinces.forEach(p => p.style.fill = defaultColor);

        // رنگ کردن استان انتخابی به زرد
        this.style.fill = "yellow";
    });
});
</script>
